import React from 'react';




class SearchForm extends React.Component {
  
  constructor(){
    super();
    this.state={
        data:{
          "depart": " ",
          "destination": " ",
          "date": " "
        }
    }
  }

  render(){

    return (
      <div class="mt-10 ">
      <form className='inline-grid grid-cols-4 grid-rows-1 gap-6 ' method='GET' action='/Ride'>
              <div class="relative z-0 mb-6  w-full group">
              <label for="countries" class="block mb-2 text-sm font-medium  dark:text-gray-400">Depart</label>
                  <select id="countries" name='depart' class=" px-4  text-gray-900 text-sm rounded focus:ring-teal-500  border border-solid border-gray-300 focus:border-teal-500 block w-full p-2.5   dark:text-white dark:focus:ring-teal-500 dark:focus:border-teal-500">
                    <option>United States</option>
                    <option>Canada</option>
                    <option>France</option>
                    <option>Germany</option>
                  </select>
                  </div>
              <div class="relative z-0 mb-6 w-full group">
              <label for="countries" class="block mb-2 text-sm font-medium  dark:text-gray-400">Destination</label>
                  <select id="countries" name="destination" class="  px-4  text-gray-900 text-sm rounded focus:ring-teal-500 border border-solid border-gray-300 focus:border-teal-500 block w-full p-2.5   dark:text-white dark:focus:ring-teal-500 dark:focus:border-teal-500">
                    <option>United States</option>
                    <option>Canada</option>
                    <option>France</option>
                    <option>Germany</option>
                  </select>                      
                </div>
              <div class=" z-0 mb-6 w-full group datepicker relative form-floating ">
              <label for="floatingInput" class="block mb-2 text-sm font-medium  dark:text-gray-400">Date</label>
                  <input type="date" name='date'
                    class="form-control block w-full px-3 py-1.5 text-base font-normal text-gray-700 bg-white bg-clip-padding border border-solid border-gray-300 rounded transition ease-in-out m-0 focus:text-gray-700 focus:bg-white focus:border-teal-600 focus:outline-none"
                    placeholder="Select a date" />
                  
                </div>
              <div class="relative z-0 mb-6 w-full group mt-6 ">
              <button  type="submit" class="text-white bg-teal-500 hover:bg-teal-600 focus:ring-4 focus:outline-none focus:ring-teal-500 font-semibold rounded-md text-lg w-full sm:w-full px-5 py-2.5 text-center dark:bg-teal-600 dark:hover:bg-teal-700 dark:focus:ring-teal-800">Chercher</button>
              </div>
            </form>  
      </div>
    );

  }
  
}

export default SearchForm;
